import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {

  return (
    <ul>
      <li>
        <Link to="/data-plotting">Data Plotting</Link>
      </li>
      <li>
        <Link to="/resource-calculator">Resource Calculator</Link>
      </li>
    </ul>
  );
}

export default NavBar;
